drop table  if exists country;
CREATE TABLE `country` (
  `country` varchar(44) DEFAULT NULL,
  `name_fr` varchar(44) DEFAULT NULL,
  `a2_iso` varchar(2) NOT NULL DEFAULT '',
  `a3_iso` varchar(3) DEFAULT NULL,
  `num_un` int(3) DEFAULT NULL,
  `ITU` varchar(3) DEFAULT NULL,
  `MARC` varchar(14) DEFAULT NULL,
  `WMO` varchar(2) DEFAULT NULL,
  `DS` varchar(3) DEFAULT NULL,
  `dialing_code` varchar(17) DEFAULT NULL,
  `FIFA` varchar(15) DEFAULT NULL,
  `FIPS` varchar(26) DEFAULT NULL,
  `GAUL` varchar(6) DEFAULT NULL,
  `IOC` varchar(3) DEFAULT NULL,
  `currency_alphabetic_code` varchar(3) DEFAULT NULL,
  `currency_country_name` varchar(44) DEFAULT NULL,
  `currency_minor_unit` varchar(1) DEFAULT NULL,
  `currency_name` varchar(29) DEFAULT NULL,
  `currency_numeric_code` varchar(3) DEFAULT NULL,
  `is_independent` varchar(22) DEFAULT NULL,
  `nationality` varchar(60) DEFAULT NULL
);


ALTER TABLE `country`
  ADD PRIMARY KEY (`a2_iso`),
  ADD KEY `currency_alphabetic_code` (`currency_alphabetic_code`),
  ADD KEY `country` (`country`);
